```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.api.java.function.PairFunction
import org.apache.spark.broadcast.Broadcast
import scala.collection.mutable.Map
import java.util.Date
import java.text.SimpleDateFormat

// Define a case class to represent a query and its timestamp
case class Query(query: String, timestamp: Date)

// Define a function to parse a string into a Query object
val parseQuery: Function[String, Query] = new Function[String, Query] {
  val dateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss")
  override def call(line: String): Query = {
    val fields = line.split(",")
    Query(fields(0), dateFormat.parse(fields(1)))
  }
}

// Define a function to extract the query from a Query object
val extractQuery: Function[Query, String] = new Function[Query, String] {
  override def call(query: Query): String = query.query
}

// Define a function to check if a query is in the cache
val isCached: Function[String, Boolean] = new Function[String, Boolean] {
  override def call(query: String): Boolean = {
    val cache = cacheMap.value
    val now = new Date()
    val twelveHoursAgo = new Date(now.getTime - 12 * 60 * 60 * 1000)
    cache.get(query) match {
      case Some(timestamp) => timestamp.after(twelveHoursAgo)
      case None => false
    }
  }
}

// Define a function to update the cache
val updateCache: Function[String, Unit] = new Function[String, Unit] {
  override def call(query: String): Unit = {
    val cache = cacheMap.value
    cache.put(query, new Date())
  }
}

// Define a function to calculate the hit rate
val calculateHitRate: Function[JavaRDD[Query], Double] = new Function[JavaRDD[Query], Double] {
  override def call(queries: JavaRDD[Query]): Double = {
    val hits = queries.filter(query => isCached.call(query.query)).count()
    val total = queries.count()
    hits.toDouble / total
  }
}

// Read the onsite attributed data and top frequent queries
val onsiteData = sc.textFile("onsite_data.csv").map(parseQuery)
val topQueries = sc.textFile("top_queries.txt").map(_.trim)

// Broadcast the top frequent queries
val topQueriesBroadcast: Broadcast[JavaRDD[String]] = sc.broadcast(topQueries)

// Initialize the cache map
val cacheMap = sc.broadcast(Map[String, Date]())

// Process each query in the onsite attributed data
onsiteData.foreach(query => {
  if (topQueriesBroadcast.value.contains(query.query)) {
    if (!isCached.call(query.query)) {
      // This is a cache miss, send a request to retrieve the query and cache it
      updateCache.call(query.query)
    }
  }
})

// Calculate the hit rate
val hitRate = calculateHitRate.call(onsiteData)
println(s"Hit rate: $hitRate")
