```python
class Group:
    def __init__(self, elements):
        self.elements = elements

    def is_element(self, x):
        return x in self.elements

    def order(self, x):
        count = 0
        for y in self.elements:
            if y * x % len(self.elements) == 1:
                return count
            count += 1
        return None

    def inverse(self, x):
        for y in self.elements:
            if y * x % len(self.elements) == 1:
                return y
        return None

# Define a group of integers under addition modulo 5
group = Group([0, 1, 2, 3, 4])

# Check if 3 is an element of the group
print(group.is_element(3))  # True

# Find the order of 2 in the group
print(group.order(2))  # 4

# Find the inverse of 3 in the group
print(group.inverse(3))  # 2
