To create a tooltip in Next.js using React Context to close previously opened tooltips, you can follow these steps:

1. Create a Tooltip context using `React.createContext()`.
```javascript
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```
2. Create a TooltipProvider component that wraps your application and provides the context to all child components.
```javascript
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
3. Create a Tooltip component that uses the context to determine whether it should be open or closed.
```javascript
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useContext(TooltipContext);

  const isOpen = activeTooltip === id;

  const handleMouseEnter = () => {
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {isOpen && <div className="tooltip">{children}</div>}
    </div>
  );
};

export default Tooltip;
```
4. Wrap your application with the TooltipProvider component.
```javascript
import TooltipProvider from './TooltipProvider';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
5. Use the Tooltip component in your application.
```javascript
import Tooltip from './Tooltip';

function MyComponent() {
  return (
    <div>
      <Tooltip id="tooltip1">Hover over me</Tooltip>
      <Tooltip id="tooltip2">Hover over me</Tooltip>
    </div>
  );
}

export default MyComponent;
```
In this example, the TooltipProvider component provides the context to all child components. The Tooltip component uses the context to determine whether it should be open or closed. When a user hovers over a Tooltip component, the `openTooltip` function is called with the component's ID. When the user moves their mouse away from the component, the `closeTooltip` function is called to close all open tooltips.

